import React from 'react';
import InputDatalist from '../../UserInterface/Input/InputDatalist';
import withSearch from '../../hoc/withSearch';
import withS from '../../hoc/withS';
function HeaderDictionary(props) {

    // поиск по таблице добавлен в hoc
   const InputDatalistWithSearch = withSearch(InputDatalist, props.dataBase);

    return(
        <div className={props.classname}>

            <h1>{props.nameHeader}</h1> 
            
            <InputDatalistWithSearch
                id='SearchBaseName'
                listId='SearchNameBase'
                placeholder='Поиск по наименованию'
                dataBase={props.dataBase}
                autocomplete='off'
                classInputDatalis='searchInputDatalis_HeaderDataBase'
                />
        </div>
    )
}

export default HeaderDictionary
